import React from "react";
import "./stylesheets/Curve.css";

class Curve extends React.Component {
	delete = () => {
		console.log(this.getKey());
	}
	render(){
		return (<span>
					<p>Curve 1 </p>
					<a href="#" onClick={this.delete}> Delete </a>
				</span>);
	}
}

export default Curve;
